import React from 'react'

class User extends React.Component {
	constructor() {
		super();
	}

	render() {
        let salary = <input onBlur={this.props.doubleClickSalary.bind(this, this.props.index)} onChange={this.props.changeSalary.bind(this, this.props.index)} value={this.props.salary} style={{width: "30px"}} type="text" />
        let days = <input onBlur={this.props.doubleClickDays.bind(this, this.props.index)} onChange={this.props.changeDays.bind(this, this.props.index)} value={this.props.days} style={{width: "30px"}} type="text" />

		return <tr key={this.props.index}>
                    <td>{this.props.name}</td>
                    <td>{this.props.surname}</td>
                    <td>{this.props.onsalary ? <div onDoubleClick={this.props.doubleClickSalary.bind(this, this.props.index)}>{this.props.salary}</div> : salary}</td>
                    <td>{this.props.ondays ? <div onDoubleClick={this.props.doubleClickDays.bind(this, this.props.index)}>{this.props.days}</div> : days}</td>
                    <td>{this.props.salary * this.props.days}</td>
                </tr>
    }
}

export default User;
